      quotes: ["There are no heroes...in life, the monsters win.", "Once you’ve accepted your flaws, no one can use them against you.", "And so he spoke, and so he spoke, that Lord of Castamere, but now the rains weep o'er his hall, with no one there to hear. Yes, now the rains weep o'er his hall, and not a soul to hear.", "A lion doesn't concern itself with the opinion of sheep.", "Fear cuts deeper than swords.", "The North remembers.", "Winter is coming.", "Do the dead frighten you?", "All dwarfs are bastards in their father's eyes", "Things are not always as they seemed, much that may seem evil can be good.", "Power is a curious thing. Who lives, Who dies. Power resides where men believe it resides. It is a trick, A shadow on the wall.", "Never forget who you are. The rest of the world won't. Wear it like an armor and it can never be used against you.", "Hodor? Hodor.", "Knowledge could be more valuable than gold, more deadly than a dagger.", "Every flight begins with a fall.", "Laughter is poison to fear.", "Nothing burns like the cold.", "Some old wounds never truly heal, and bleed again at the slightest word.", "... a mind needs books as a sword needs a whetstone, if it is to keep its edge.", "When you play a game of thrones you win or you die.", "Why is it that when one man builds a wall, the next man immediately needs to know what's on the other side?", "And I have a tender spot in my heart for cripples and bastards and broken things.", "When the snows fall and the white winds blow, the lone wolf dies but the pack survives.", "Give me honorable enemies rather than ambitious ones, and I'll sleep more easily by night.", "The things I do for love.", "Summer will end soon enough, and childhood as well."]
